%[text] %[text:anchor:H_5ECB4528] # Import Data and Analyze
%[text] In this exercise, we will import data from a file and perform some analysis on the data. 
%[text] Online Documentation
%[text] - [Data Types](https://salcedoe.github.io/MtMdocs/dataProcessing/dataTypes/)
%[text] - [Tidy Data](https://salcedoe.github.io/MtMdocs/dataProcessing/tidyData/)
%[text] - [Tables](https://salcedoe.github.io/MtMdocs/matlabBasics/Tables/)
%[text] - [Plotting](https://salcedoe.github.io/MtMdocs/matlabBasics/PlottingComponents/) \
%[text] ## Learning Objectives
%[text] - Compare and Contrast different Data types and understand which  MATLAB variables are most appropriate
%[text] - Import Spreadsheet data as a Table
%[text] - Apply Group statistics to the rows
%[text] - Visualize Data from the table \
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] 
%%
%[text] ## Importing Data
%[text] First, we clear all variables and change the Current Folder to the `MTMdata/unit1` folder.
clc
clearvars
mmSetUnitDataFolder(1); % change current folder to the unit1 folder %[output:833b2c08]
%%
%[text] ### Data: Capstone Project studying a Remote Ultrasound Learning Module
%[text] The data for this example is actual data from an MHA capstone project. This data was collected to test the educational value of a remote learning module covering ultrasound. The data is stored in an excel file called "teleultrasound\_data.xlsx". You can review the data in Excel by right-clicking on the file in the `unit1` folder and selecting "Open outside of MATLAB."
%[text] As you can see, the table has Four Columns:
%[text] 1. **Student**: the student ID
%[text] 2. **Score**: The student's Likert ranking for a given question (range from 1-5)
%[text] 3. **Question:** the question ID
%[text] 4. **Site:** Location of the learning (in person or virtual) \
%[text] Notice that the [data in the table is tidy](https://salcedoe.github.io/MtMdocs/dataWrangling/tidyData/).
%[text] 1. Each row corresponds to an observation
%[text] 2. Each variable is a column
%[text] 3. Each type of observation is in a different table \
%%
%[text] You  can directly import spreadsheets into MATLAB tables using the built-in import function. Select the "Import Data" button (found in the Home Tab)
%[text] ![](text:image:67d8)
%[text] Select the "teleultrasound\_data.xlsx" file.  
%[text] You should see the following window that has a Ribbon strip with some options already selected. Below the ribbon there is a spreadsheet viewer with the data to be imported displayed. 
%[text] ![](text:image:4602)
%[text] 
%[text] Notice that Site and Question will be imported as Categorical arrays. We'll get to those in a bit. The light blue coloring in the spreadsheet view indicates what data will be imported
%[text] %[text:anchor:H_DE47C496] ### Try it now
%[text] Select one of the data cells.
%[text] - What happens to the light blue coloring?
%[text] - What happens to the **Selection/History** box at the top?
%[text] - Click around. Try to select more than one cells and keep an eye on **Selection/History** \
%[text] Select all four columns and rows 2:36
%[text] - The simplest way to do this is to bring up the **Selection/History** pop-up menu and choose the (Initial) setting.
%[text] - Make sure that the range reads "A2:D36" and **Variable Names Row =** `1`. \
%[text] Set Column A to "Categorical"
%[text] In the **Name** box, rename  "teleultrasound\_data"  to **T**. This will set the created variable name to *`T.`*
%[text] Click on the Green "Import Selection" button.
%[text] - What happens? Hint: Look in the workspace. \
%[text] Look in the workspace. You should have a variable *T.* If, instead, you have a variable *teleultrasound\_datadata*, simply rename the variable in the workspace by double-clicking on the name in the workspace. 
%%
%[text] ### Create a Script
%[text] If you are going to import the same table over and over, you may want to create a script to so. This is really easy with the **Import Tool**.
%[text] 1. Switch back to the **Import Tool** button
%[text] 2. Click and Hold the Green "Import Selection" button
%[text] 3. Select "Generate Live Script"
%[text] 4. Select the New Live script Tab
%[text] 5. Copy the code and paste here \

%[text] Review the code: 
%[text] - What's the Data Range?
%[text] - What are the Variable Names?
%[text] - What are the Variable Classes?
%[text] - What is the Name of the Variable to be Created? \
%%
%[text] ### Level up: Now, create a Function
%[text] 1. Copy and paste below the script you created in the Previous Code Block
%[text] 2. Highlight the code, right-click, and then select "Create Local Function"
%[text] 3. Rename the new function "myTableImporter"
%[text] 4. Change the output from the function to `T` \
function T = myTableImporter(workbookFile, sheetName, dataLines)
%IMPORTFILE Import data from a spreadsheet
%  T = IMPORTFILE(FILE) reads data from the first worksheet in the
%  Microsoft Excel spreadsheet file named FILE.  Returns the data as a
%  table.
%
%  T = IMPORTFILE(FILE, SHEET) reads from the specified worksheet.
%
%  T = IMPORTFILE(FILE, SHEET, DATALINES) reads from the specified
%  worksheet for the specified row interval(s). Specify DATALINES as a
%  positive scalar integer or a N-by-2 array of positive scalar integers
%  for dis-contiguous row intervals.
%
%  Example:
%  T = importfile("/Users/ernesto/MATLAB-Drive/MtMdata/unit1/teleultrasound_data.xlsx", "Sheet1", [2, Inf]);
%
%  See also READTABLE.
%
% Auto-generated by MATLAB on 04-Sep-2025 13:11:03

%% Input handling

% If no sheet is specified, read from Sheet1
if nargin == 1 || isempty(sheetName)
    sheetName = "Sheet1";
end

% If row start and end points are not specified, define defaults
lastRowOfDataIdx = 0;
if nargin <= 2
    dataLines = [2, Inf];
    lastRowOfDataIdx = 1;
elseif dataLines(end,2) >= Inf
    lastRowOfDataIdx = size(dataLines, 1);
end

%% Set up the Import Options and import the data
opts = spreadsheetImportOptions("NumVariables", 4);

% Specify sheet and range
opts.Sheet = sheetName;
if lastRowOfDataIdx == 1
    opts.DataRange = "A" + dataLines(1, 1);
else
    opts.DataRange = "A" + dataLines(1, 1) + ":D" + dataLines(1, 2);
end

% Specify column names and types
opts.VariableNames = ["Student", "Score", "Question", "Site"];
opts.VariableTypes = ["double", "double", "categorical", "categorical"];

% Specify variable properties
opts = setvaropts(opts, ["Question", "Site"], "EmptyFieldRule", "auto");

% Import the data
T = readtable(workbookFile, opts, "UseExcel", false);

for idx = 2:size(dataLines, 1)
    if idx == lastRowOfDataIdx
        opts.DataRange = "A" + dataLines(idx, 1);
    else
        opts.DataRange = "A" + dataLines(idx, 1) + ":D" + dataLines(idx, 2);
    end
    tb = readtable(workbookFile, opts, "UseExcel", false);
    T = [T; tb]; %#ok<AGROW>
end

end
%[text] - Try clearing all variables and then calling your Function \
%%
clearvars
file_path = fullfile(matlabdrive,"MtMdata","unit1","teleultrasound_data.xlsx") %[output:20d0a1a3]
%%
file_path = "/Users/ernesto/MATLAB-Drive/MtMdata/unit1/teleultrasound_data.xlsx" %[control:filebrowser:85a7]{"position":[13,81]} %[output:4f5c2b88]
T = myTableImporter(file_path) %[output:3d3286cb]
%%
%[text] #### Update the Function
%[text] The function (and script) currently are hard-coded to load the file you initially selected. If you move that file, your function will no longer work. To improve issues like this, it is usually best to add an input into the function that allows you to interactively specify the location of the file. 
%[text] (1) In your function, change the **`readtable`** line to read as follows:
%[text] ```matlabCodeExample
%[text] T = readtable(filepath, opts, "UseExcel", false)
%[text] ```
%[text] - basically, we are replacing the hard-coded path with a more flexible variable \
%[text] (2) In the function header line, add an input to the function by adding parentheses after the function name, as follows:
%[text] ```matlabCodeExample
%[text] function T = myTableImporter(filepath)
%[text] ```
%[text] 
