%[text] You can add a GUI widget to help create full paths to files. 
%[text] Let's add a file browser control that creates such a full path. You can find such a control in the Control Menu:
%[text] ![](text:image:3ea5)![](text:image:7149)
%[text] In the code block below 
%[text] 1. Insert a file browser control. Name the output from the control: `filepath`
%[text] 2. Use your function to read in the table.
%[text] 3. Assign the output from your function to T2 \

%%
%[text] %[text:anchor:H_16850615] ## Data Analysis
%%
%[text] The function **summary** gives us a quick summary of the different columns
summary(T) %[output:0020aaa1]
%[text] - Notice that we get different summaries for the different data types.
%[text] - For Numeric classes, we get typical stats, like Min, Median, Max
%[text] - For Categorical classes, we get counts of the different categories \
%%
%[text] ### Basic stats
%[text] We can perform basic stats on the data by simply  plugging in a column of data into one of our MATLAB stats functions.
mean(T.Score) %[output:4d40b033]
std(T.Score) %[output:5933a14c]
%[text] - This returns the overall mean and standard deviation of the scores column \
%%
%[text] %[text:anchor:H_BB9CE18C] ### Group Statistics
%[text] An overall mean like the one calculated above, may not make much sense for our data analysis. Since we have two categories, in person vs online, it makes more sense to calculate two means: one for the in person scores and one for the online scores. This is really easy to do since we have all of our data organized in a table. 
%[text] First, though, a word about [Perform Calculations by Group in Table](https://www.mathworks.com/help/matlab/matlab_prog/perform-calculations-by-group-in-table.html).
%[text] ![](text:image:943d)
%[text] Broadly speaking, the variables in a table can be either *grouping* variables or *data* variables. 
%[text] - Data variables describe events or observations
%[text] - Grouping variables group these events or observations \
%%
%[text] ### Grouping by Logical Indexing
%[text] One way to calculate these separate means is to use logical indexing and pull out the rows needed to calculate the means. 
%[text] How would you create a logical array of the rows in ***T*** that contain the in-person scores?
la = T.Site == "in person" %[output:89c11ec3]
%%
%[text] Use that logical array to index the in-person scores and then calculate the mean of just the in-person scores
mean(T.Score(la)) %[output:0d078133]
%%
%[text] Without creating a new logical array, how would you calculate the "virtual" scores?
mean(T.Score(~la)) %[output:0f3f526f]
%%
%[text] How would you calculate the standard deviation?
std(T.Score(la)) %[output:908ab84c]
%%
%[text] %[text:anchor:H_91CFD3E9] #### Group summary
%[text] So, with some creative logical indexing, we can hone in on the data that we want to analyze, but this requires multiple lines of code. And there is actually a far simpler way: **groupsummary**
%[text] The function **groupsummary** does all of the row indexing for you and then applies the statistics. 
%[text] Consider the following: 
S = groupsummary(T,"Site",["mean" "std" "median"],"Score") %[output:6fc1435d]
%[text] Notice
%[text] - With this one line of code, we break our table down into two groups and calculate both the mean and standard deviations of the scores.
%[text] - This function returns a new table that organizes the statistical results
%[text] - In the new table, **S**, the in-person scores were higher than the virtual scores.
%[text] - Also notice that the group counts differ between the two groups \
%%
%[text] #### You Try:
%[text] - Calculate the mean and standard deviation score for each student using **`groupsummary`****.**
%[text] - Sort rows of the new table by mean score \
S = groupsummary(T,["Question" "Site"],["mean" "std"],"Score") %[output:879582a9]
%[text] - Which Student had the highest score? lowest? \
%%
%[text] ## Data Visualization
%[text] An important part of data analysis is visualization. 
%[text] But, first, let's explore the components of a figure in MATLAB. 
%[text] ### Create a figure
%[text] A figure is a window onto which you add plots
figure(Visible="on",Name="My First Figure",Color='magenta')
%[text] - here, we set the figure's visible property to "on" so that it is displayed outside of the live script
%[text] - Dock the figure by clicking on the docking icon: ![](text:image:38c9)
%[text] - The input into figure is called a Paired input: Visible is the Property we want to set and "on" is the property value we want to set \
%%
%[text] Try it now. Type **figure** in the code block below and the first parentheses
figure
%[text] - Type Visible and the enter tab until you get `Visible='on'`
%[text] - Add a second paired input of `Name='My First Figure'`
%[text] - The default is the paired input, where you first name the property to set and then you enter the value of the property \
%%
%[text] ### Parent-Child Relations
%[text] The layering system in MATLAB is termed the Parent-Child relationship. The figure is the parent and everything added to a figure is a child.
%%
%[text] ### Axes
%[text] For plotting data, you need a axes. The function **axes** creates an empty axis
axes %[output:51e3b915]
%[text] - axes is the child of the figure
%[text] - the figure is the parent of the axes \
%%
%[text] ### Data
%[text] Now, we are ready to add some data
%[text] The most basic plotting function is **plot.** Here we plot a single point at the xy coordinate of (5, 10)
plot(5,10,'*') %[output:5e95a0d4]
%[text] - This Point is the child of the axes
%[text] - You can change to marker: Try sq or d
%[text] - You can change the color. Try 'm' or 'r' \
%%
%[text] To plot a line, we need a least two points. Here we plot a line between coordinates (5,10)  and (9,21)
plot([5 9], [10 21],'r*:') %[output:1adbaeea]
%[text] - Notice that the syntax is a little confusing
%[text] - The first input contains all of the X-coordinates for the line
%[text] - The second input contains all the Y-coordinates for the line
%[text] - the third input contains the formatting information ('Red, Square Markers, Filled Line') \
%%
%[text] How would you add a third point to your line? At (15,4)
plot([5 9 15 1], [10 21 4 2],'r*:') %[output:8729e4d0]
%%
%[text] ### Bar Plots
%[text] Fortunately, most of the plotting we do does not involve painstaking plotting out point coordinates. Typically, you have a bunch of data that you want to plot out. For example, let's plot the mean of our score as a bar plot
%[text] Let's create a bar plot of our group statistics
%%
%[text] #### Step 1. Get data and plot the bars
figure % create a new figure %[output:897ce5fc]
x = S.Site; % grouping variable
y = S.mean_Score; % mean score

bar(x,y) % create bar plot %[output:897ce5fc]
%%
%[text] #### Step 2. Add labels and a Title
ylabel("Score") % y-axis label %[output:46baa285]
%[text] - Note:  **ylabel** is a property of the axes. \
%%
title('Tele-Ultrasound Analysis') % title %[output:5d65680e]
%%
%[text] #### Step 3. Overlay Error bars
%[text] The function **errorbar** creates error bars. Since this is a separate function, we need to turn the overlay function on, by calling "hold on". Otherwise, **errorbar** would overwrite the bar plot. 
hold on % turn on overlay %[output:8fd08ea6]
e = S.std_Score; % error

errorbar(x,y,e) %[output:8fd08ea6]
%%
%[text] ### Step 4. Clean up Figure Properties
%[text] The default plot settings are usually pretty ugly. Luckily, its easy to prettify a plot. 
%[text] 1. Click on white arrow in Figure tool bar
%[text] 2. Double click on figure and update properties to look more like this: \
%[text] ![](text:image:8685)
%[text] - Increase Font Size
%[text] - Change Bar face color and alpha
%[text] - Change Bar Line Width
%[text] - Change error bar color and thickness
%[text] - Remove connecting line between error bars \
%%
%[text] #### 
%[text] Generate Code and paste here

%%
%[text] ### Box Plots
%[text] Box plots visualize summary statistics for a set of observations. The boxes in said plots are the interquartile range and the whiskers are the full data range. 
%[text] We can visualize the scores use box plots using the **boxchart** function
figure %[output:2deaaedf]
x = T.Site; % group by site
y = T.Score; % rating

hb = boxchart(x,y); %[output:2deaaedf]
ylim([0 5]) %[output:2deaaedf]
%[text] - We have some uneven distributions in our scores, so the box plots look a little wonky (only whiskers pointing down and and no median line)
%[text] - Also, since these are rankings, we don't have a huge range or variability in the data \
%%
%[text] #### Data tips
%[text] To get some more information about our box charts, we can add data tips to the plots
%[text] 1. Hover over the plot until the plotting toolbar appears
%[text] 2. Click on the Datatip tool ![](text:image:3dfd).
%[text] 3. Hover the mouse pointer over one of the box plots
%[text] 4. When the pointer turns into a precision pointer (like a big plus sign), click on the box plot
%[text] 5. You should now see a datatip on the box plot \
%[text] 
%[text] ![](text:image:9ab5)
%[text] - More information about the plot is displayed. What does this tell us about our data distribution?
%[text] - Where is the median? \
%[text] Change Datatip appearance
%[text] - Right-click on the datatip and change display to "Window Inside Figure"
%[text] - This changes the datatip to a floating window that can be moved around \
%[text] ![](text:image:4300)
%%
%[text] ### Plot handles
%[text] Every plotting function returns an output. You don't need to assign this output to a variable for the plotting to work, but if you do, you get live access to the plotted chart's properties. 
%[text] This output is called a plot handle, and we just assigned one to *hb* when we created our box chart. 
hb.BoxFaceColor = [0.949 0.404 0.773]; %[control:colorPicker:1f0d]{"position":[19,38]} %[output:94983da3]
hb.BoxFaceAlpha = .3; %[output:94983da3]
%[text] - Notice that the plot handle is a *BoxChart* handle
%[text] - Click on "Show all properties" to see the plotted properties of the chart in the command window
%[text] - Notice that these properties are the same properties that you see when you bring up the Property Inspector \
%%
hb.Parent.Color = 'k' %[output:6921076c]
%%
%[text] #### Update Box chart
%[text] Using the *`hb`* plot handle to:
%[text] - Change the BoxFaceColor
%[text] - Change the BoxFaceAlpha  \
%%
%[text] ### Swarm Charts
%[text] Box charts visualize the distribution statistics of a set of data, but sometimes the true nature of the distribution remains hidden, especially when the sample size is small. 
%[text] This is why it is often best to plot all the data points. For grouped data, we can do this using the **swarmchart** function. Notice we are plotting the exact same data, just as a swarm chart.
figure %[output:250abb61]
hs = swarmchart(x,y,XJitterWidth=.5) % same x and y as before %[output:250abb61] %[output:4a00a63e]
%[text] - Now we have one dot for each student
%[text] - But, again, the default plot settings leave much to be desired \
%%
%[text] ### Update Marker Properties
%[text] Since we assigned the swarmchart handle to *hs,* we can change the properties of the figure
%[text] Warning: do not close the figure or the handle won't work
hs.MarkerFaceColor = 'k'; % set marker to black %[output:3f88f910]
hs.MarkerEdgeColor = 'k'; % edge color (try 'none') %[output:3f88f910]
hs.MarkerFaceAlpha = 0.25; % transparency %[output:3f88f910]
hs.XJitterWidth = 0.5; % separation between dots (try 0.5 or .15) %[output:3f88f910]
%[text] - So, now we see why our box plots look so weird
%[text] - The scores are whole numbers and there is not a lot of variation between student responses \
%%
%[text] **Try it now**: Close the figure. What happens to *hs?*
%%
%[text] ### Overlaying Plots
%[text] It is often desirable to overlay multiple plots in the same axes. In  MATLAB, overlay is called "hold" and you can turn hold on or off between in a figure.
%[text] For example, let's overlay the swarm charts and the box plots
figure % create figure %[output:4ceeafef]
hb = boxchart(x,y); % box plot %[output:4ceeafef]
ylim([0 5]) % adjust the y limits %[output:4ceeafef]

hold on % TURN ON OVERLAY %[output:4ceeafef]

hs = swarmchart(x,y,... % swarm chart %[output:group:50babd09] %[output:4ceeafef]
    MarkerFaceColor='k',... %[output:4ceeafef]
    MarkerEdgeColor='k',... %[output:4ceeafef]
    MarkerFaceAlpha=0.25,... %[output:4ceeafef]
    XJitterWidth=0.25); %[output:group:50babd09] %[output:4ceeafef]
%[text] - Notice in **swarmchart** that we added all of the marker properties settings in the function call. This allows us to set the properties the way we like it \
%[text] Try it now:
%[text] - Turn hold off
%[text] -  modify the marker colors
%[text] - Resize the docked figure \
%%
%[text] #### Course function 
%[text] The course function **mmBoxSwarm** overlays box plots and swarm charts with one function call
figure; %[output:2e28c844]
mmBoxSwarm(x,y) %[output:2e28c844]
%%
%[text] You can add inputs to **`mmBoxSwarm`** to adjust the colors.
%[text] Try it now. 
%[text] After `figure`, type: `mmBoxSwarm(x,y,`
%[text] - Change the Marker Face color to 'k'
%[text] - Change the Box Face Color to red
%[text] - Adjust the `XJitterWidth` to 0.5 \
%[text] Then, change the Y Limits to range from 0 to 5, using **`ylim`** and add a y-axis label of "Score" using **`ylabel`**
figure %[output:452b127c]
mmBoxSwarm(x, y, 'MarkerFaceColor', 'k', 'BoxFaceColor', 'r', 'XJitterWidth', 0.5); %[output:452b127c]
ylim([0 5]); %[output:452b127c]
ylabel('Score'); %[output:452b127c]

%%
%[text] ### Multiple Groups - Group by Question
%[text] Box plots and Swarm Charts are really useful for display multiple grouped data in the same axes. For example, we can plot  the range of scores for each question 
%[text] #### Try it now 1
%[text] 1. Set *x* to Question
%[text] 2. Set *y* to Score
%[text] 3. Plot x and y using **`mmBoxSwarm`** \
x = T.Question;
y = T.Score;

figure %[output:757ec611]
mmBoxSwarm(x,y) %[output:757ec611]
%%
%[text] ## Multiple Plots in the Same Figure
%[text] The function **nexttile** adds multiple axes to the same figure
figure %[output:3780376e]
nexttile % turn tiling on %[output:3780376e]
%%
%[text] Every time you call **nexttile,** an axes gets added to the figure
nexttile %[output:3235721f]
%[text] - try running this code block multiple times
%[text] - The default layout is called "flow" - this adds the tiles in an ever growing matrix \
%%
%[text] ### Organizing the tiles
%[text] The function **`tiledlayout`** helps you control the organization of the tiles
figure %[output:47237bed]
tiledlayout("vertical") %[output:47237bed]
%%
nexttile %[output:59c6500f]
%[text] - call this block multiple times \
%[text] Now you try:
%[text] 1. Go back and change the input in `tiledlayout` to "vertical"
%[text] 2. Re-run that code block
%[text] 3. Re-run this codeblock multiple times
%[text] 4. What happens? \
%%
%[text] ### Plotting the Question Statistics
%[text] Let's visualize the Questions statistics both as a Bar Plot and as a Swarm/Box Chart in the same figure, as follows:
%[text] ![](text:image:4c50)
%[text] #### Calculate Mean and Standard Deviation
%[text] %[text:anchor:TMP_3dc0] For the bar plot, we will plot the mean and standard deviation of each question. To calculate these stats, we use the function `groupsummary, as follows:`
S = groupsummary(T,"Question",["mean" "std"],"Score") % group summary per question %[output:1049cfa1]
%%
%[text] #### Bar Plots
%[text] First we set up our figure as follows:
figure %[output:90bbc9ee]
tiledlayout("horizontal") %[output:90bbc9ee]
nexttile % new tile for the bar plot %[output:90bbc9ee]
%[text] - these 3 commands create a new figure, set up the tile configure, and create an empty axis \
%%
%[text] %[text:anchor:TMP_26f7] Then we add the bar and error plots. These plots will get added to the axis we created in the previous step. 
x = S.Question; % grouping variable
y = S.mean_Score; % mean score
bar(x,y,FaceAlpha=0.5) % create bar plot %[output:5d9f5838]
hold on %[output:5d9f5838]

e = S.std_Score; % get the standard deviation as the error
errorbar(x, y, e, 'k', 'LineStyle', 'none'); % add error bars to the bar plot %[output:5d9f5838]
title("Bar Plot") % add a title to the axis %[output:5d9f5838]
ylim([0 5.25]); % set the y-axis limits %[output:5d9f5838]
ylabel('Score'); % Label the y-axis %[output:5d9f5838]
%[text] - Right now, since there is only 1 tile, the tile automatically fills the figure \
%%
%[text] #### Swarm and Box Overlays
%[text] Next we add the swarm and box plot overlays. But we first need to call `nexttile` to create a new tile. Also, notice for the Swarm and Box Chart, we use the values from the `T` table (because we are plotting every single data point).
nexttile % new tile for Swarm Chart %[output:9fd97c5e]

x = T.Question; % question 
y = T.Score; % rating

mmBoxSwarm(x,y,"MarkerFaceColor",'k') %[output:9fd97c5e]
% Set the y-axis limits and add a y-axis label
ylim([0 5.25]); % set the y-axis limits %[output:9fd97c5e]
title("Swarm + Box Plot overlay") % add a title to the axis %[output:9fd97c5e]
%[text] - Now our tiles are side-by-side
%[text] - What happens if we run this code block again? \
%%
%[text] #### Add Overall Title
%[text] The function `sgtitle` adds a title above all of the tiles
sgtitle("Question Stats") % overall title %[output:7d96887d]

